INSERT INTO `tbl_info_links` VALUES (1,'New Driver FAQ','<p><span style=\"font-size: medium;\"><strong><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; FREQUENTLY ASKED QUESTIONS&nbsp;</em></strong></span></p>\r\n<p><span style=\"font-size: small;\">Q - What steps should I take to get a permit to drive campus vehicles?</span></p>\r\n<p><span style=\"font-size: small;\">A - Print out the \"Driver Application - Step 1\" form and fill it out.&nbsp; Get your school leader to sign it and take it to the tansportation office to schedule a drive test.<br /></span></p>\r\n<p><span style=\"font-size: small;\">Q &ndash; What should&nbsp; I do after I pass the drive test?</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif; font-size: small;\">A - Read the driver agreement on the home page.&nbsp; Enter your information on the \"Driver Registration - Step 2\" page under the User tab of this system.&nbsp; Click on the \"Register\" button at the bottom of the page</span><span style=\"font-size: small;\">.&nbsp; You will immediately receive an email acknowledgement saying your information is being checked out by the transportation manager.&nbsp; In a few days, you will get a second email telling you that your account has been activated. &nbsp;<span style=\"font-size: small;\">That email will include a system-generated password that you MUST use the first time you login.</span>&nbsp; Login using that password. &nbsp;BEFORE YOU MAKE YOUR FIRST RESERVATION, you should change your password to something you like and can remember.</span></p>\r\n<p><span style=\"font-size: small;\">Q - A friend of mine said he got in trouble for \'abandoning\' a reservation he had made.&nbsp; What is that?</span></p>\r\n<p><span style=\"font-size: small;\">A -If you can\'t use a reservation you have made, you must notify the transportation office AND cancel the reservation in the online system.&nbsp; It is important that you so this MORE THAN 12 HOURS BEFORE YOUR PLANNED DEPARTURE! &nbsp; Please remember that other schools should have a reasonable opportunity to use the vehicle in the time slot of your reservation.&nbsp; This issue impacts the campus community, so be responsible and let the office know EARLY when you will not be using your reservation.<em><strong>&nbsp; </strong></em></span></p>\r\n<p><span style=\"font-size: small;\"><em><strong>Trips that are not cancelled according to this rule, or are just \"forgotten about\" are considered abandoned.&nbsp; Excessive abandoned trips will result in the cancellation of the offender\'s driving permit and cause his/her school to pay an community impact fee.</strong><br /></em></span></p>\r\n<p><span style=\"font-size: small;\">Q &ndash; What if I have driven here before and been tested earlier?</span></p>\r\n<p><span style=\"font-size: small;\">A &ndash; Go to the home page and click on \"Driver Renewal Instructions\"</span></p>\r\n<p><span style=\"font-size: small;\">Q - When I make a reservation, how can I quickly see what vehicles are available for the event I am dealing with?</span></p>\r\n<p><span style=\"font-size: small;\">A - When you get to the Reservations page, open the \"Graph Pending Trips\" function shown under the Reservations tab. &nbsp;This graph will show you what vehicles are available in the time slot you are dealing with.</span></p>\r\n<p><span style=\"font-size: small;\">Q - What should I do if I have a problem with the vehicle when I am away from the campus?</span></p>\r\n<p><span style=\"font-size: small;\">A &ndash; If the oil pressure light comes on OR the engine overheats, you should stop and call 808-756-7147 or 808-345-1911 for advise.&nbsp; Other problems or unusual noises should be reported on your trip slip that you turn in to the Transportation Office when you get back.</span></p>\r\n<p><span style=\"font-size: small;\">Q - We want to take our class of 38 people to the beach.&nbsp; How many vans can we reserve for this?</span></p>\r\n<p><span style=\"font-size: small;\">A - Depending on availability, you can reserve two large (15 passengers) vans and one sedan or station wagon&hellip;. That would give you room for 35.&nbsp; If you need more vehicles, you may need to contact a local rental agency.</span></p>\r\n<p><span style=\"font-size: small;\">Q - Is it OK to use the vans on the weekend?</span></p>\r\n<p><span style=\"font-size: small;\">A - Yes providing you pick up the keys and gas card by 3 pm on Friday.</span></p>\r\n<p><span style=\"font-size: small;\">Q &ndash; What if I&rsquo;m short on time when I go to get my keys at the office and the place is jammed with people?</span></p>\r\n<p><span style=\"font-size: small;\">A - Your keys and, if needed, a gas card will be hanging on the Departure board in the Transportation office.&nbsp; You can take them without discussion with the TM.&nbsp;&nbsp; They will be attached to a slip of paper with your reservation number clearly shown.&nbsp; Grab &lsquo;em and go.&nbsp;</span></p>\r\n<p><span style=\"font-size: small;\">Q - Where do the shuttle runs stop in town?</span></p>\r\n<p><span style=\"font-size: small;\">A &ndash; They stop at Target and Walmart only.&nbsp; Other stops at restaurants and businesses are prohibited unless supervised by a campus leader.&nbsp; Rev Oct. 2012</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2014-12-10 02:15:14',4,'home','0'),(3,'Driver Agreement','<p style=\\\"text-align: center;\\\"><span style=\\\"font-size: medium;\\\"><strong><em>U of N - DRIVER AGREEMENT &amp; RESPONSIBILITIES</em></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will operate University vehicles in a safe and legal manner and in accordance with the policies of the University of the Nations.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">If I need to cancel a reservation, I will notify the transportation office by phone AND cancel the trip in online system <span style=\\\"text-decoration: underline;\\\">no later than 12 hours before the scheduled departure time.</span></span><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">&nbsp; I understand that other schools should have a reasonable opportunity to use the vehicle in the time slot of the reservation I had made.</span> <em></em></strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\"><em><strong>&nbsp; I understand that trips that are not cancelled according to this rule, or are just \\\"forgotten about\\\" are considered abandoned.&nbsp; Excessive abandoned trips will result in the cancellation of my driving permit and cause my school to pay a community impact fee.</strong></em></span></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will submit a copy of my new drivers license from my home state or country when it expires.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">In the event of an accident that involves personal injury or property damage, I will notify the POLICE BY CALLING 911.&nbsp; Immediately after calling 911 I will also call the Transportation Office at 808-326-4460 or the Security Office at&nbsp;808-345-1911.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will complete an insurance accident form describing any accident I am involved in. &nbsp;These forms may be found in each vehicle . &nbsp;A completed accident form will be submitted to the Transportation Office.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will report faulty vehicle equipment and especially safety-related systems such as brakes, steering, lights, turn signals, mirrors and windshield wipers.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will use University vehicles exclusively for purposes approved by University or school leaders.&nbsp; I will not use these vehicles for personal purposes of any kind.&nbsp;</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will take responsibility for the safety of my passengers and require them to wear seat belts when available.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will drive only on developed roads built with asphalt or gravel.&nbsp; I will not drive on lava rock, sand or in areas designated for 4-wheel drive vehicles.&nbsp; I will not drive to the Mauna Kea summit.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will drive over speed bumps VERY slowly, nearly coming to a complete stop. </span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will not use a Cel phone while driving. </span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will comply with the campus speed limit of 15 MPH. </span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will report the beginning and ending mileage of every trip taken as well as the ending gas level.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will inspect the interior and exterior of the vehicle for damage before each trip &amp; record any damage found on the trip slip.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will remove all trash and debris from my vehicle when I return it to the campus.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will insure that all interior and exterior lights are turned off when I park a vehicle.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will make vehicle reservations at least 24 hours in advance of a planned trip.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will pick up the keys for any weekend reservation I have made by 3 PM Friday</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will fill the gas tank whenever I am issued a gas card and check the gas guage before each trip.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will put the completed trip slip and keys into the door mail slot&nbsp;<em>IMMEDIATELY when I return a vehicle</em></span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">I will return the vehicle I have used to the campus ON TIME AS PLANNED. &nbsp; I understand other groups will be waiting to use it after me.&nbsp; I will allow a cushion in our schedule to insure we make it back on time.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\"><span style=\\\"text-decoration: underline;\\\">Other Information</span>: &nbsp;All tickets issued by the police are the financial responsibility of the driver and will not be paid by the University.&nbsp; </span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">Negligent driving or violations of these instructions may result in suspension of driving privileges.</span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">If your group will include a child under age 4, you will need to reserve a car seat.&nbsp; Children age 5 &ndash; 8 must be in a booster seat.&nbsp;&nbsp; </span></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">There is a limit of two large vans per trip.&nbsp; A third smaller vehicle may be included when available. If you need more vehicles you may need to contact a local rental agency.&nbsp; The Transportation Manager has information on the prevailing rates charged by these agencies.&nbsp;</span></strong></span></p>\r\n<p><span style=\\\"text-decoration: underline; font-size: x-small;\\\"><em>I understand that excessive abandoned trips will result in the cancellation of my driving permit and cause my school to pay a community impact fee.</em></span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\\\"font-size: medium; font-family: arial,helvetica,sans-serif;\\\"><span style=\\\"font-size: small;\\\">Signed ________________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Date</span> __________________</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\\\"font-size: medium; font-family: arial,helvetica,sans-serif;\\\"><span style=\\\"text-decoration: underline;\\\"><span style=\\\"font-size: x-small;\\\">Rev. March 2013</span><br /></span></span></strong></p>\r\n<p><strong><span style=\\\"font-size: medium; font-family: arial,helvetica,sans-serif;\\\">&nbsp;</span></strong></p>\r\n<p><strong>&nbsp;</strong></p>','2014-12-10 02:16:46',3,'home','1'),(14,'New Driver Msg # 2 (activation)','<p>--SUBJECT--</p>\r\n<p>Driver Approval and Activation Notice</p>\r\n<p>--END SUBJECT--</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p>Dear User,</p>\r\n<p><span style=\"font-size: small;\">Your Drivers\' Account with the University Transportation office has been approved and activated. &nbsp;&nbsp;Please use your temporary password (shown below) to login for the first time.&nbsp; After you have logged in,&nbsp;<strong>immediately</strong>&nbsp;change your password to something you can easily remember.</span></p>\r\n<p><span style=\"font-size: small;\">Your username, password and group level are as follows:</span></p>\r\n<p><span style=\"font-size: small;\">Username: #USERNAME#&nbsp;</span></p>\r\n<p><span style=\"font-size: small;\">Temporary Password: #PASSWORD#</span></p>\r\n<p><span style=\"font-size: small;\">Group Level: #USER LEVEL#</span></p>\r\n<p><span style=\"font-size: small;\">You can copy your temporary password to the system Login Sreen by the&nbsp; &lsquo;cut and paste&rsquo; method or by writing it down and then entering it.&nbsp;&nbsp; Do not include the colon symbol : with your temporary password.&nbsp; After you have logged in for the first time,&nbsp;<strong>IMMEDIATELY&nbsp;change</strong> your password to something you can easily remember.&nbsp; Keep this email until you have successfully changed your password.</span></p>\r\n<p>Thank you,</p>\r\n<div>\r\n<p><strong>University of the Nations Transportation Team</strong></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>--END MESSAGE BODY--</p>','2014-12-10 02:15:14',10,'','0'),(5,'DRIVER  RETURNING  WITH  OLD  PERMIT','<p><span style=\"font-size: medium;\"><strong><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\"><span style=\"font-size: large;\"><em>Returning Driver with old permit - Renewal Process&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br /></em></span></span></strong></span></p>\r\n<p><span style=\"font-family: \'arial black\', \'avant garde\'; font-size: small;\">Check with the Transportation Manager to see if your driver\'s account is still active. If it is not active, follow the steps below to renew it.&nbsp; If you have forgotten your old password, and have not changed your email address, the system will email it to you when you use the \'forgot your password\' function on the login screen.</span></p>\r\n<p><span style=\"font-family: \'arial black\', \'avant garde\'; font-size: small;\"><span><strong><span>1 - Update your personal information in the reservation system by using the \'Update Registration\' function found under the \'Renew Permit\' tab.&nbsp; Update your details including any accidents or</span></strong></span><span><strong><span> tickets as well as the expiration date of your governmental drivers license.</span></strong></span><br /><br /><span><strong><span>2 &ndash; Pick up a copy of the &ldquo;Campus Driver Renewal Request&rdquo; form in the Transportation</span></strong></span><span><strong><span> Office. &nbsp;OR you can be print it out using the \"Renewal Request Form\" function under this tab.&nbsp; Fill out the driver&rsquo;s</span></strong></span><span><strong><span> section of the form and take it to the school leader you will be driving for next.&nbsp; Ask them to review</span></strong></span><span><strong><span> the form and sign it where indicated.</span></strong></span><br /><br /><span><strong><span>3 - Bring the completed form and your government driver\'s license to the transportation</span></strong></span><span><strong><span> office so it can be copied.</span></strong></span><span><strong><span>&nbsp;&nbsp;</span></strong></span></span><span style=\"font-family: \'arial black\', \'avant garde\'; font-size: small;\">You will also need to sign a copy of the Drivers Agreement. &nbsp;The TM will explain the other steps you will need to complete in order to use the system.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2014-12-10 02:15:14',5,'','0'),(11,'Coordinator-Staff Position','<p><span style=\"font-size: medium;\">The Coordinator-Staff position (User Group) is reserved for staff-drivers who have been ASKED BY THEIR SCHOOL OR DEPARTMENT LEADER to place reservations in behalf of the other drivers in their school or department.&nbsp; This function was created by the leaders of the larger schools to better manage their transportation costs and vehicle reservations. &nbsp;Staff assigned to this role are expected to be communicators of the policies of the transporation program and representatives of the Transportation Manager.</span></p>\r\n<p><span style=\"text-decoration: underline; font-size: medium;\">The Transportation Office must have an email from a school or department leader requesting that a driver be registered in this group.</span></p>','2014-12-10 02:15:14',1,'home','0'),(12,'Dept. Cross Charge Notice','<p>--SUBJECT--</p>\r\n<p>POSSIBLE TRANSPORTATION CHARGING ERROR&nbsp;</p>\r\n<p>--END SUBJECT--</p>\r\n<p>&nbsp;</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p>Your department has been billed for van reservation No. ___<strong>#RESV NO#</strong>__that was charged to you by another department,&nbsp;that reservation was made by&nbsp;<strong>#TESTING PERSON#</strong>.&nbsp;&nbsp; If you did not approve this reservation, please contact&nbsp;<strong>#TESTING PERSON#&nbsp;</strong>so they can arrange to have this billing corrected.</p>\r\n<p><strong>University of the Nations</strong></p>\r\n<p><strong>Transportation Team</strong></p>\r\n<p>--END MESSAGE BODY--</p>\r\n<p>&nbsp;</p>\r\n<p>Note to Administrator:</p>\r\n<p>You can change the message body whatever you need so long as you include&nbsp; <strong>#RESV NO#</strong>&nbsp;and&nbsp;<strong>#TESTING PERSON#</strong> viariables INCLUDING THE # SIGN (these are essential for the System\'s Coding).</p>\r\n<p>the rest of the message will be displayed just as you wrote it</p>','2014-12-10 02:15:14',12,'','0'),(13,'New Driver Msg # 1 (acknowledge registration)','<p>--SUBJECT--</p>\r\n<p>Thank you for registering</p>\r\n<p>--END SUBJECT--</p>\r\n<p>&nbsp;</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p><span style=\"font-size: small;\">Thank you for taking your driving test and registering in this reservation system. We will review the information on your application as soon as possible.&nbsp; You should receive an email \"Notice of Activation\" in the next few days.&nbsp; When you receive this notice, you will then be able to login with a temporary password and place reservations using this system.<br /></span></p>\r\n<p>Thank you,</p>\r\n<div>\r\n<p><strong>University of the Nations Transportation Team</strong></p>\r\n</div>\r\n<p>--END MESSAGE BODY--</p>','2014-12-10 02:15:14',11,'','0'),(8,'Parking Permits','<p><span style=\\\"font-size: large;\\\">Application for U of N Parking Permit - Staff Only&nbsp;</span></p>\r\n<p><span style=\\\"font-size: small;\\\">(Temporary Parking permits are issued at the Go Center)</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Owner Name ________________________________</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Phone # ____________________</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Email Address ________________________</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Security Badge No. ________________</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Vehicle Details:</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Year _________ Make _____________ Model _____________</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Color _________ License Plate # __________ State _______</span></p>\r\n<p><span style=\\\"font-size: large;\\\">---&gt;Bring this completed form&nbsp;to the Transportation Office</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Office use below:</span></p>\r\n<p><span style=\\\"font-size: large;\\\">Permit No. Issued: ________ &nbsp;Date Issued _______________</span></p>\r\n<p>&nbsp;</p>','2014-12-10 02:16:04',6,'home','1'),(9,'User Application - Step 1','<p><span style=\"font-size: large;\"><strong>Campus Driver Application </strong></span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"font-size: xx-small;\">&nbsp;(print and complete this form including your leader\'s signature &nbsp;&ndash; then take it to Trans. Office)</span></p>\r\n<p><strong><em><span style=\"text-decoration: underline;\">The person named below is recommended to take the campus driving test:</span></em></strong></p>\r\n<p>Leader Signature: _________________________________Phone:______________ Date: _____________&nbsp;</p>\r\n<p>Dept. Name: ______________________________________Dept.(project) No. __________</p>\r\n<p><strong><em><span style=\"text-decoration: underline;\">Driver Details from drivers license:</span></em></strong></p>\r\n<p>First Name: _________________________ Last Name: _______________________</p>\r\n<p>I have a valid drivers license in ____________________________________ (State and/or Nation)</p>\r\n<p>&nbsp; &nbsp; &nbsp; Describe any accidents you were involved in during the last 3 years, including dates &amp; details:</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; __________________________________________________________________________________</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If any accident listed here, were you considered at fault by the insurance company?&nbsp;&nbsp; Yes&nbsp;&nbsp; No</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Have you had any moving violations charged to you?&nbsp; If yes, give dates and details:&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; __________________________________________________________________________________</p>\r\n<p>&nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-size: medium;\"><strong><em>Agreements</em></strong></span></p>\r\n<p> I will comply with the current U of N Drivers Agreement and the policies of the Transportation Department as periodically revised.</p>\r\n<p> I understand that my driving permit expires Dec. 31<sup>st</sup> each year and must be renewed according to the \"Permit Renewal Instructions\" that are available on the TMS home page.</p>\r\n<p> When my home drivers license expires, I will bring my new one to the Transportation Office to be copied.</p>\r\n<p style=\"margin-left: 30px;\"><span style=\"text-decoration: underline; font-size: medium;\"><em><strong>Financial Liability</strong></em></span></p>\r\n<p>I understand that I <strong>MAY</strong> be held Financially Liable for the Insurance Deductible <strong>IF</strong> the accident is deemed to my fault.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Signed ______________________________ Printed name ___________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Date:&nbsp;&nbsp; ________________________&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (print this form,&nbsp; fill it out &nbsp;&ndash; then take it to Trans. Office)</p>\r\n<p>&nbsp;&nbsp;</p>\r\n<h2><span style=\"color: #000000;\"><em><span style=\"font-size: xx-small;\">NOTE TO&nbsp; TESTER:&nbsp; Attach the Performance test results (table) to this application when test is completed</span></em></span></h2>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2014-12-10 02:15:14',2,'home','0'),(24,'LEADERS MASS EMAIL MSGS','<p>Aloha!</p>\r\n<p>We here at the Transportation Department hope that your first 2 weeks have been amazing!</p>\r\n<p>We want to give a few reminders and to also bring attention to a new policy regarding usage the Flatbed.</p>\r\n<p align=\\\"center\\\" style = \\\"text-align:center;\\\"><strong>****Reminders****</strong></p>\r\n<p><strong>Reservation slips have all the information that you need to know.&nbsp; There are 3 highlighted areas that you </strong><span style=\\\"color: #ff0000;\\\"><strong><span style=\\\"text-decoration: underline;\\\">MUST FILL OUT:&nbsp; Beginning mileage, ending mileage and gas level.</span></strong><strong> &nbsp;&nbsp;</strong></span><strong></strong></p>\r\n<p><strong>If you receive a gas card, it is</strong><strong>&nbsp;</strong><span style=\\\"color: #ff0000;\\\"><strong><span style=\\\"text-decoration: underline;\\\">MANDATORY</span></strong></span><strong>&nbsp;</strong><strong>that you fill the vehicle with gas. &nbsp; The exception is if it is already 75% or 100% full at </strong><span style=\\\"color: #ff0000;\\\"><strong><span style=\\\"text-decoration: underline;\\\">the end of your trip.</span></strong></span></p>\r\n<p><strong>If your trip is canceled for any reason, </strong><span style=\\\"color: #ff0000;\\\"><strong><span style=\\\"text-decoration: underline;\\\">you must cancel the trip online.</span></strong></span><strong> </strong><strong>You will need to go back the UofN Transportation system to cancel the trip.</strong></p>\r\n<p><strong>It is your responsibility to make sure the vans are clean (NO TRASH OR LEFT OVER ITEMS).</strong><strong>&nbsp;</strong></p>\r\n<p><strong>If someone</strong> <strong>drives for you, make sure your name is crossed out and the other driver puts his/her name as the driver.</strong></p>\r\n<p><span style=\\\"color: #ff0000;\\\"><strong><span style=\\\"text-decoration: underline;\\\">Vehicles are for University trips EXCLUSIVELY = NO PERSONAL USE OF VEHICLES.</span></strong></span></p>\r\n<p align=\\\"center\\\" style = \\\"text-align:center;\\\"><strong>****New Flatbed Policy ****</strong></p>\r\n<p><strong>Due to the recent use of the Flatbed by unauthorized drivers, we now have to implement a new procedure to where the individual driver needs to get preauthorization before they can operate the vehicle. Please come and see us at Transportation for more information and to see if you are an authorized driver for this vehicle. </strong><span style=\\\"color: #ff0000;\\\"><strong><span style=\\\"text-decoration: underline;\\\">You will not be able to operate the Flatbed until you come and talk with us.</span></strong></span><strong> </strong></p>\r\n<p>Mahalo for all of your hard work and cooperation,</p>\r\n<p>Transportation and Campus Services</p>','2016-07-20 20:18:16',24,'leader','0'),(10,'Airport Parking Warning ','<p><span style=\\\"font-size: large;\\\"><strong>&nbsp;Airport Parking Warning - Possible Fine</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\\"font-size: medium;\\\"><strong><span class=\\\"text10black2\\\">This is a reminder for all UofN Drivers who Pick up and Drop Off people at the Airport with a Campus Vehicle. <br /> <br />All Campus Vans and Cars have Commercial Vehicle Passes which REQUIRES ALL PICK UPS AND DROP OFFS to take place in the commercial vehicle parking areas located at the north and south side of the terminals. <br /> <br />This is where you normally see the buses parked. <br /> <br />Curbside pick up and drop offs - with a campus vehicle - ARE NOT PERMITTED and will be subject to a $35 fine. <br /> <br />It is a UofN Policy for the Driver to be responsible to pay for all fines incurred while driving a Campus Vehicle. <br /> </span></strong></span></p>\r\n<p><span style=\\\"font-size: medium;\\\"><strong><span class=\\\"text10black2\\\"><span style=\\\"font-size: large;\\\">Also, recently many of our drivers are getting pulled over by the airport security and being reminded to slow down, and to let me know to let you guys know. Please follow the speed limit signs that are posted. If you get a ticket you are responsible to pay the fine.</span><br /></span></strong></span></p>\r\n<p><span style=\\\"font-size: medium;\\\"><strong><span class=\\\"text10black2\\\">If you have any questions, please come see us in Transportation or Security for clarification.</span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>--END MESSAGE BODY--</p>','2015-12-23 18:54:36',7,'','0'),(15,'Bulk Email Message','<pre>Aloha Nicole,<br /><br />Thanks for bringing the keys back, however, I need the credit card that was issued to you as well.  Please come to the Transportation Office as soon as possible today.<br /><br />Nancy</pre>','2019-06-21 20:58:30',8,'','0'),(16,'Driver Deactivation Notice When Dept. Deactivated','<p>--SUBJECT--</p>\r\n<p>YOUR REGISTRATION IN THE VAN RESERVATION SYSTEM</p>\r\n<p>--END SUBJECT--</p>\r\n<p>&nbsp;</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p>When you registered in the campus Transportation System, you assigned yourself to a \\\"Home Department\\\". That Department has been charged for the reservations and trips you have taken in the past. This message is to advise you that &nbsp;your Home Department charge number has been closed and as a result, your privileges to make van reservations are now suspended. &nbsp;If you still need to use our campus vans, you will need to come to the transportation office to be reassigned to a different Home Department.</p>\r\n<p>Thank you,</p>\r\n<p><strong>University of the Nations Transportation Team</strong></p>\r\n<p>--END MESSAGE BODY--</p>','2015-06-25 03:33:27',9,'','0'),(25,'Restore Suspended Driver - Message','<p>--SUBJECT--</p>\r\n<p>Driving permit restoration</p>\r\n<p>--END SUBJECT--</p>\r\n<p><span style=\"font-size: small;\">--MESSAGE BODY--</span></p>\r\n<p><span style=\"font-size: small;\">Dear Driver,</span></p>\r\n<p><span style=\"font-size: small;\">Your driving permit and with its responsibilities and privileges have been restored.<br /></span></p>\r\n<p><span style=\"font-size: small;\">Thank you,</span></p>\r\n<div>\r\n<p><span style=\"font-size: small;\"><strong>University of the Nations Transportation Team</strong></span></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: small;\">--END MESSAGE BODY--</span></p>','2014-12-10 02:15:14',25,'','0'),(27,'Permit Renewal Steps','<h1 style=\"text-align: center;\"><strong>DRIVER PERMIT RENEWAL PROCESS - STEPS</strong></h1>\r\n<h2><strong>Step 1 (Admin or TM)</strong></h2>\r\n<p><span style=\"font-size: medium;\">Admin sends the \"Year end notice\" to all drivers that have been using the system (system sends it to those who have used it in the last 4 mos). Recommended timing for this notice is Nov. 20 - Dec 1st so there is enough time for the renewals before the teams leave on outreach. [Yr end notice is under the MSGS tab]</span></p>\r\n<p>&nbsp;</p>\r\n<h2>Step 2 (Driver)</h2>\r\n<p><span style=\"font-size: medium;\">Drivers update their details online using the \"Renew Driver Permit\" function that will display their registration detail record. When they do this, their permit will be immediately suspended until it is renewed by the admn or TM. They will be prompted to do this in response to receiving the msg \"Year end notice\".</span></p>\r\n<h2>Step 3 (Driver)</h2>\r\n<p><span style=\"font-size: medium;\">Driver gets renewal form signed by the leader of their next school or Dept.</span></p>\r\n<p>&nbsp;</p>\r\n<h2>Step 4 (Admin &amp; Driver)</h2>\r\n<p><span style=\"font-size: medium;\">Driver takes the signed form and his/her government license to the transportation office for an interview with the admin or TM. During the interview, the Admin or TM reviews the driver\'s record in the system that the driver updated earlier (Step 2). He/she makes a copy of the drivers government license and clicks on the \"Renew this driver\" button on the OK permit renewal page (under the \"Driver-User List\" function)</span> &nbsp; &nbsp;</p>','2014-12-10 02:15:14',1,'','0'),(17,'Vehicle Removed for Service Work','<p>--SUBJECT--</p>\r\n<p>Vehicle Removed for Service Work</p>\r\n<p>--END SUBJECT--</p>\r\n<p>&nbsp;</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p>Your reservation No. #RESERVATION# for vehicle No. __#VEHICLE NO#__ on Date __#ON DATE#___ has been cancelled for repairs or administrative reasons.&nbsp; This vehicle is no longer available for reservations.&nbsp; Please choose another vehicle to make a new reservation for your needs.</p>\r\n<p>IF and when this vehicle is restored to service, you will be notified.</p>\r\n<p>Thank you,</p>\r\n<p><strong>Your Transportation Team</strong><span><br /></span></p>\r\n<p>--END MESSAGE BODY--</p>','2014-12-10 02:15:14',13,'','0'),(18,'Activate - Restore Vehicle to Service from permanent removal','<p>--SUBJECT--</p>\r\n<p>&nbsp;Vehicle is available again</p>\r\n<p>--END SUBJECT--</p>\r\n<p>&nbsp;</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p>Recently we had to cancel a reservation you had placed for vehicle No. __#VEHICLE NO#__ for maintenance work. &nbsp; This message is to let you know that vehicle No. __#VEHICLE NO#__ is available again for reservation.&nbsp;</p>\r\n<p>Thank you,</p>\r\n<p><strong>Your Transportation Team</strong></p>\r\n<p>--END MESSAGE BODY--</p>','2014-12-10 02:15:14',14,'','0'),(19,'Abandon Trip Warning #1 - MSG SENT WHEN ACTIVATED BY TM-ADMN','<p>-<span style=\\\"font-size: small;\\\">-SUBJECT--</span></p>\r\n<p><strong><span style=\\\"font-size: small;\\\">Abandoned Reservation - Warning #1<br /></span></strong></p>\r\n<p><span style=\\\"font-size: small;\\\">--END SUBJECT--</span></p>\r\n<p><span style=\\\"font-size: small;\\\">--MESSAGE BODY--</span></p>\r\n<p><span style=\\\"font-size: medium;\\\">Dear #username#</span></p>\r\n<p><span style=\\\"font-size: medium; font-family: tahoma, arial, helvetica, sans-serif;\\\">Recently you made #resvno# but did not use it as planned.&nbsp; This reservation is recorded as an abandoned trip. <span style=\\\"background-color: #ffffff;\\\"><span class=\\\"text10black2\\\">&nbsp;</span></span></span></p>\r\n<p><span style=\\\"font-size: medium; font-family: tahoma, arial, helvetica, sans-serif;\\\"><span style=\\\"background-color: #ffffff;\\\"><span class=\\\"text10black2\\\">An abandoned </span></span><span style=\\\"background-color: #ffffff;\\\"><span class=\\\"text10black2\\\">reservation is when you fail to use a vehicle as planned without notice of any kind -OR- you fail to cancel a trip at least 12 hours in advance.&nbsp; Abandoned reservations deprive other schools of the opportunity to use the vehicle in the time slot of the reservation you made. &nbsp;</span></span></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\\"font-size: medium; font-family: tahoma, arial, helvetica, sans-serif;\\\">Please make <strong><span style=\\\"text-decoration: underline;\\\">EVERY EFFORT</span></strong> to cancel your trip online as soon as you know that the vehicle is no longer needed.</span></p>\r\n<p><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif; font-size: medium;\\\">If you have more then 2 abandoned reservations, your driving privileges will be suspended until you are able to come to the office with your Department leader to discuss your ability to be an authorized Campus Driver.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\\"font-size: medium;\\\">Thank you for your assistance in helping us have an effective Transportation Department</span></p>\r\n<p><span style=\\\"font-size: medium;\\\"><br /></span></p>\r\n<p><span style=\\\"font-size: medium;\\\"><strong>U of N Transportation Team</strong></span></p>\r\n<p>--END MESSAGE BODY--</p>','2016-09-29 19:04:32',15,'','0'),(20,'Driver Request Form - RENEWAL OR NEW','<p style=\"text-align: justify;\"><span style=\"font-size: medium;\"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Driver Permit Request (renewals or new) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (Drivers: print &amp; fill out this form, <em><span style=\"text-decoration: underline;\">get your leader\'s signature</span></em>, then take it to Trans. Office)</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">I am requesting that the driving permit of the person listed below be renewed for the coming year.&nbsp; I will need him/her to serve my school by driving campus vehicles in the first quarter.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">Leader Signature: ________________________________ Date: ______________</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">Dept. Name: ______________________________________Dept. No. __________</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><strong><em>Driver Details:</em></strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">First Name: _________________________ Last Name: _______________________</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\">Status:&nbsp; Staff &nbsp;&nbsp; Student  Mission Builder&nbsp; </span></p>\r\n<p style=\"text-align: left;\"><span style=\"text-align: justify; font-size: small;\">Instructions to Driver:&nbsp; As a first step, please use the online reservation system to update your</span></p>\r\n<p style=\"text-align: left;\"><span style=\"text-align: justify; font-size: small;\"> personal details.&nbsp; AFTER that is done and your leader has signed above, bring this signed form and</span></p>\r\n<p style=\"text-align: left;\"><span style=\"text-align: justify; font-size: small;\"> your governmental drivers license to the Transportation Office to be photo copied.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\">&nbsp;<strong><em>Agreements</em></strong></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">&nbsp;Upon renewal of this authorization, I agree to comply with the following:</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  I will comply with the U of N Drivers Agreement</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  I understand that my driving permit will expire Dec. 31<sup>st</sup> unless it is renewed.<br /></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  When my home government\'s drivers license expires, I will bring my new license</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; to the Transportation Office to be photocopied.</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">Signed ________________________________ </span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">Printed name ___________________________</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">Phone: ________________________________</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">Date __________________________________</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\">Rev Jan. 22, 2013</span></p>','2014-12-10 02:15:24',20,'','0'),(21,'PERMIT RENEWAL - approval message to driver','<p>--SUBJECT--</p>\r\n<p><span style=\"font-size: medium;\">DRIVING PERMIT RENEWAL</span></p>\r\n<p>--END SUBJECT--</p>\r\n<p>&nbsp;</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p><span style=\"font-size: medium;\">TO: Driver of University vehicles<br /></span></p>\r\n<p><span style=\"font-size: medium;\">Your driving permit has been renewed.&nbsp; Your new home department is #Dept_Name#&nbsp; Your password has not been changed.&nbsp; Your permit to drive campus vehicles has been extended until #PERMIT END DATE#.&nbsp;&nbsp; However, if you stop using the system for six months, your account will be deleted.</span></p>\r\n<p><br /><br /> <strong>Thank you,</strong></p>\r\n<p><strong><br /> Your Transportation Team&nbsp; </strong></p>\r\n<p>--END MESSAGE BODY--</p>','2014-12-10 02:15:14',21,'','0'),(23,'Late Trip Cancellation -Abandon warning by system','<p>--SUBJECT--</p>\r\n<p>Late Trip Cancellation -Abandon warning by system</p>\r\n<p>--END SUBJECT--</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p><span style=\\\"font-size: small;\\\">Dear #username#</span></p>\r\n<p><span style=\\\"font-size: small;\\\">You recently made reservation number #resvno# for a trip you planned to take on #departdate# and then cancelled it.&nbsp; Your cancellation was recorded less than 12 hours before your scheduled departure time or after the departure time. This reservation is being recorded as abandoned by you.&nbsp; </span></p>\r\n<p><span style=\\\"font-size: small;\\\">When you do this you deprive other schools of a reasonable chance to use the vehicle in the time slot you had it reserved for.&nbsp; Out of consideraton for the other schools on campus, please be more careful about cancelling or not using reservations you have made.&nbsp; </span></p>\r\n<p><span style=\\\"font-size: small;\\\">If you continue to abandon trips in this way, your driving privileges may be suspended.</span></p>\r\n<p><span style=\\\"font-size: small;\\\">Thank you,</span></p>\r\n<p><span style=\\\"font-size: small;\\\"><strong>Your Transportation Team<br /></strong></span></p>\r\n<p><span style=\\\"font-size: small;\\\">Transportation Administrator</span></p>\r\n<p>--END MESSAGE BODY--</p>','2016-09-29 19:06:57',23,'','0'),(22,'Driver Renewal Notice','<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif;\\\">Aloha!</span></strong></span></p>\r\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif;\\\">Sorry for the inconvienece, but due to our Insurance Company\\\'s request of an accurate drivers list every quarter; as of January 4th 2016<span style=\\\"color: #ff0000;\\\"> EVERYONE</span> will be deactivated as a Campus Driver. There will be <span style=\\\"color: #ff0000;\\\">NO</span> exceptions, this goes for any staff in ALL level of leadership. Drivers who need to continue driving campus vehicles each quarter will need to follow these steps:</span></strong></span></p>\r\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif;\\\">1 &ndash; Please pick up a copy of the<span style=\\\"color: #ff9900;\\\"> &ldquo;Campus Driver Renewal Request&rdquo;</span> form in the Transportation</span></strong></span><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif;\\\"> Office, it is also in the file box outside of the office hanging on the wall next to the window.&nbsp; This form can also be printed out using the <span style=\\\"color: #339966;\\\">\\\"Renewal Request Form\\\"</span> function under this tab.&nbsp; Fill out the driver&rsquo;s</span></strong></span><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif;\\\"> section of the form and have your school leader sign the top portion.<br /></span></strong></span></p>\r\n<p style=\\\"text-align: justify;\\\"><strong></strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif; font-size: small;\\\"><strong>2 - <span style=\\\"color: #ff0000;\\\">ALL</span> drivers driving for a school must be on the <span style=\\\"color: #3366ff;\\\">\\\"Transportation Authorization Form<span style=\\\"color: #000000;\\\">\\\", this list is approved by the school leader.</span></span> This form can be picked up in the office.</strong></span></p>\r\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif;\\\">3 - Please bring the completed form and your government Driver\\\'s License to the transportation</span></strong></span><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif;\\\"> office so it can be copied. If all of your information is up to date and your leader has signed all forms then you will be re-activated.</span></strong></span></p>\r\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif; font-size: small; color: #ff0000;\\\">If you are not coming back or no longer wish to be a Campus Driver, please let me know so I can make the necessary adjustments in our system.</span></p>\r\n<p style=\\\"text-align: justify;\\\"><span style=\\\"font-size: small;\\\"><strong><span style=\\\"font-family: tahoma,arial,helvetica,sans-serif;\\\">Mahalo for your time and cooperation in this matter. Thank you for serving the campus and helping the Transportation Department run smoothly. <br /></span></strong></span></p>','2015-12-23 19:04:34',22,'home','1'),(26,'Abandon Notice W / Charge of 25 Miles','<p>--SUBJECT--</p>\r\n<p><strong>Abandon Trip Notice - With Charge of 25 Miles</strong></p>\r\n<p>--END SUBJECT--</p>\r\n<p>--MESSAGE BODY--</p>\r\n<p><span style=\"font-size: small;\">Dear #username#</span></p>\r\n<p><span style=\"font-size: small;\"><strong>Recently you made #resvno# but failed to use it as planned or cancel it according to the policy that has been explained to you.&nbsp; This reservation is considered abandoned by you. &nbsp;</strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>Since this is the third trip you have abandoned in the last 60 days, your driving permit is now cancelled. &nbsp;In addition, your school is being charged for 25 miles of vehicle use as a community impact fee .&nbsp; Abandoned reservations deprive other schools of the opportunity to use the vehicle in the time slot of the reservation you had made.</strong></span></p>\r\n<p><span style=\"font-size: x-small;\"><strong>If you want to appeal this decision, please have your school or department leader contact the transportation manager.</strong></span></p>\r\n<p><span style=\"font-size: small;\">Thank you,</span></p>\r\n<p><span style=\"font-size: small;\"><strong>University of the Nations Transportation Team</strong></span></p>\r\n<p>--END MESSAGE BODY--</p>','2014-12-10 02:15:14',1,'','0'),(28,'Invoice','<p>LOVE</p>','2016-02-11 19:47:51',28,'home','0'),(29,'Campus Driver Expectations, Policy, Terms and Conditions','<p style=\\\"text-align: center;\\\" align=\\\"center\\\"><strong>CAMPUS DRIVER INFORMATION</strong></p>\r\n<p style=\\\"text-align: center;\\\" align=\\\"center\\\"><strong>&nbsp;</strong></p>\r\n<p style=\\\"text-align: center;\\\" align=\\\"center\\\"><strong>In order to better serve the campus, please have your reservations in by 7:00 am the day of the trip.&nbsp; Remember, reservations can be made 60 days in advance</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong><span style=\\\"text-decoration: underline;\\\">KEYS ARE READY:</span></strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>By 8-9:00 every morning Monday-Friday.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>Weekends and Monday trips before 7:00 am will be ready by 3:00 Friday &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong><span style=\\\"text-decoration: underline;\\\">&nbsp;GENERAL INFO:</span></strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---Make sure you use the correct Department to charge reservation to school &nbsp; &nbsp;&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>&nbsp;---Reservation slips have all the information that you need to know.&nbsp; There are 3 highlighted areas that you MUST FILL OUT:&nbsp; Beginning mileage, ending mileage and gas level. &nbsp;</strong><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---If you receive a gas card, it is <span style=\\\"text-decoration: underline;\\\">MANDATORY</span> that you fill the vehicle with gas. &nbsp; The exception is if it is already 75% or 100% full.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---If your trip is canceled for any reason&hellip; You must Cancel the trip online. You will need to go back the UofN Transportation system to cancel the trip.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong></strong><strong>Failure to do so will be considered abandonment. &nbsp;&nbsp;</strong><strong>&nbsp; &nbsp; &nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---Limit of 3 vehicles at one time&mdash;if you need more, shuttle back and forth. &nbsp; &nbsp; &nbsp;&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>&nbsp;---It is your responsibility to make sure the vans are clean (NO TRASH OR LEFT OVER ITEMS). &nbsp; &nbsp; &nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---If you drive for someone else, cross out their name and write in yours.&nbsp; Same if someone </strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>drives for you, make sure your name is crossed out and the other driver puts his/her name as driver.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---Church on Sunday is paid for by General Fund; all other are paid for by the school with Leader&rsquo;s approval ONLY.&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---Vehicles are for University trips EXCLUSIVELY = NO PERSONAL USE OF VEHICLES</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---put keys and trip slip in the gold slot on the door of Transportation IMMEDIATELY as soon &nbsp;as you park.&nbsp; No keeping keys until later.&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---make sure all light both inside and outside are off when you park the vehicle.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---DO NOT leave the car door open with the radio on when car is stopped, will run down the &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; battery.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>-----------------------------------------------------------------------------------</strong></p>\r\n<p style=\\\"text-align: left;\\\">&nbsp;</p>\r\n<p style=\\\"text-align: left;\\\">&nbsp;</p>\r\n<p style=\\\"text-align: left;\\\">&nbsp;</p>\r\n<p style=\\\"text-align: left;\\\"><strong><span style=\\\"text-decoration: underline;\\\">Disciplinary Actions for following will be:</span></strong></p>\r\n<ul style=\\\"text-align: left;\\\">\r\n<li><strong>You keep the van and do not return ON TIME</strong></li>\r\n<li><strong>You keep the keys in your possession but return the van</strong></li>\r\n<li><strong>You keep forgetting to fill out reservation slip correctly</strong></li>\r\n<li><strong>Receive a gas credit card and do not fill up the tank</strong></li>\r\n<li><strong>Order a vehicle and not use it (abandoned) </strong></li>\r\n</ul>\r\n<p style=\\\"text-align: left;\\\"><strong>1<sup>st</sup> Offense </strong></p>\r\n<p style=\\\"text-align: left;\\\">-Driving privileges will be suspended until&hellip;</p>\r\n<p style=\\\"text-align: left;\\\">You can come into the Transportation office for a verbal discussion as to why offense occurred</p>\r\n<p style=\\\"text-align: left;\\\">-After Verbal discussion your driving privileges may be re-instated</p>\r\n<p style=\\\"text-align: left;\\\"><strong>2<sup>nd</sup> Offense</strong></p>\r\n<p style=\\\"text-align: left;\\\">-Driving privileges will be suspended until&hellip;</p>\r\n<p style=\\\"text-align: left;\\\">You can come into the Transportation office WITH YOUR <strong><span style=\\\"text-decoration: underline;\\\">SCHOOL / DEPARTMENT LEADER</span></strong> for a verbal discussion as to why 2<sup>nd</sup> offense occurred</p>\r\n<p style=\\\"text-align: left;\\\">-After Verbal discussion, and with your SCHOOL / DEPARTMENT LEADER&rsquo;s <strong>approval,</strong> your driving privileges may be re-instated.</p>\r\n<p style=\\\"text-align: left;\\\"><strong>3<sup>rd</sup> Offense</strong></p>\r\n<p style=\\\"text-align: left;\\\">-Driving privileges will be suspended until&hellip;</p>\r\n<p style=\\\"text-align: left;\\\">You can come into the Transportation office WITH YOUR <strong><span style=\\\"text-decoration: underline;\\\">SCHOOL / DEPARTMENT LEADER</span></strong> for a verbal discussion as to why 3<sup>rd</sup> offense occurred.</p>\r\n<p style=\\\"text-align: left;\\\">-After Verbal discussion, and with your SCHOOL / DEPARTMENT LEADER <strong>approval</strong>, your driving privileges may be suspended for minimum of 14 to 30 days.</p>\r\n<p style=\\\"text-align: left;\\\"><strong>4<sup>th</sup> Offense</strong></p>\r\n<p style=\\\"text-align: left;\\\">Your driving privileges will be suspended.</p>\r\n<p style=\\\"text-align: left;\\\">---------------------------------------------------------------------------------</p>\r\n<p style=\\\"text-align: left;\\\"><strong>You <span style=\\\"text-decoration: underline;\\\">MAY NOT</span> take any campus vehicle &ldquo;around the Island&rdquo;, to MAKAPALA, to SOUTH POINT or to HILO without prior approval from the Transportation Dept .and Campus Mechanic.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>Please do not be disappointed if the trip is denied.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>The Campus vehicles <span style=\\\"text-decoration: underline;\\\">ARE NOT ALLOWED</span> to go on Mauna Kea Road, down Wiaopio Valley, or any other 4 wheel access road.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong><em>Feel free to contact any of the&nbsp; local Car Rental Agencies should you want to drive to those locations.</em></strong><strong><em></em></strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>&nbsp;------------------------------------------------------------------------------------</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>IF YOU ARE INVOLVED IN AN ACCIDENT:</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---above the sun visor is a packet with all the information you need.&nbsp; Call the police &ndash; get all&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; info from other driver&nbsp; - take pictures &ndash; call transportation @ 808-756-7147.&nbsp; Call Security @ 808-345-1911 for a SERIOUS injury ONLY</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---if you get a ticket &ndash; you pay for it</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>---if you&rsquo;re involved in an accident which was caused by you &amp; the vehicle has&nbsp; damage, you may be required to pay the deductible ranging from $250-1000.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong><span style=\\\"text-decoration: underline;\\\">Automatic Driving Suspension</span></strong><strong> will occur when you as a driver are involved in <span style=\\\"text-decoration: underline;\\\">any type</span> of vehicle accident.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>If it is determined that you are at fault, your UofN Kona driving privileges will be permanently suspended.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>If it is determined that you are NOT at fault, your UofN Kona driving privileges <span style=\\\"text-decoration: underline;\\\">may</span> be reviewed by the Campus Leadership Team as to whether your privileges will be re-instated.</strong></p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\"><strong>&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\"><strong>You are responsible for the safety of others.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\"><strong>Use wisdom when driving.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>EVERYONE MUST WEAR A SEATBELT &ndash; NO EXCEPTIONS.&nbsp; Car seats are available to use in the loft of the Transportation Office.</strong></p>\r\n<p style=\\\"text-align: left;\\\"><strong>&nbsp;</strong></p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\"><strong>NO CELL PHONE USE = $300 fine. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </strong></p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\"><strong>Do not pick up even to look at the time.</strong><strong></strong></p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\"><strong>&nbsp;-----------------------------------------------------------------</strong></p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\"><strong>My signature below signifies that I have read all the above listed items with regards to the UofN Kona Transportation Driver Expectiations, Policy, Terms and Conditions</strong></p>\r\n<p style=\\\"text-align: left;\\\">&nbsp;</p>\r\n<p style=\\\"text-align: left;\\\">&nbsp;</p>\r\n<p style=\\\"text-align: left;\\\"><strong>Name: ______________________________________________________&nbsp;&nbsp;&nbsp;&nbsp; date:________</strong></p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\">&nbsp;</p>\r\n<p style=\\\"text-align: left;\\\" align=\\\"center\\\">&nbsp;</p>\r\n<p style=\\\"text-align: center;\\\" align=\\\"center\\\">&nbsp;</p>','2016-07-20 19:35:50',29,'home','1');
