INSERT INTO `tbl_special_notice` VALUES (1,'2015-05-12 11:31:37',1362,'LOGIN NOTICE','<p><span style=\\\"font-size: large; background-color: #ffff99;\\\"><strong><span class=\\\"text10black2\\\"><span style=\\\"font-size: x-large;\\\">&nbsp; &nbsp; WORDS TO THE WISE</span> &nbsp;&nbsp;&nbsp; </span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\\"font-size: large; background-color: #ffff99;\\\"><strong><span class=\\\"text10black2\\\"><strong><span><span class=\\\"text10black2\\\">NOTICE MAY 12, 2015 : THOSE WHO ABANDON 3 TRIPS IN 60 DAYS WILL HAVE THEIR DRIVER\\\'S PERMIT SUSPENDED.</span></span></strong></span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\\\"font-size: medium; background-color: #ffff99; font-family: tahoma,arial,helvetica,sans-serif;\\\"><span class=\\\"text10black2\\\">DO NOT ABANDON A TRIP YOU HAVE MADE! &nbsp; &nbsp;An abandoned reservation is when you fail to use a vehicle as planned without notice of any kind -OR- you fail to cancel a trip at least 12 hours in advance.&nbsp; Abandoned reservations deprive other schools the opportunity to use the vehicle in the time slot of the reservation you made.</span></span></strong></p>\r\n<p>&nbsp;</p>');
